css:
.nuclide-changed-file {
  display: flex;
  /* Override the color of file-icons according to their VCS state. */
}
.nuclide-changed-file .nuclide-changed-file-name {
  display: flex;
  flex-grow: 1;
  overflow: hidden;
  cursor: pointer;
}
.nuclide-changed-file .nuclide-changed-file-name:hover {
  color: #d7dae0;
}
.nuclide-changed-file .nuclide-changed-file-name:hover .nuclide-changed-file-name-icon:before {
  color: #d7dae0;
}
.nuclide-changed-file .nuclide-changed-file-name .icon-file-text {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}
.nuclide-changed-file.text-error .nuclide-changed-file-name:hover .icon::before,
.nuclide-changed-file.text-success .nuclide-changed-file-name:hover .icon::before,
.nuclide-changed-file.text-warning .nuclide-changed-file-name:hover .icon::before {
  color: #d7dae0;
}
.nuclide-changed-file.text-success .icon::before {
  color: #73c990;
}
.nuclide-changed-file.text-warning .icon::before {
  color: #e2c08d;
}
.nuclide-changed-file.text-error .icon::before {
  color: #ff6347;
}
.nuclide-changed-file-checkbox {
  margin-right: 5px;
}
.nuclide-changed-file-checkbox .nuclide-ui-checkbox {
  margin-bottom: 2px;
}
.nuclide-changed-file-actions {
  cursor: pointer;
  display: none;
  margin-left: auto;
  padding-left: 10px;
}
.nuclide-changed-file:hover .nuclide-changed-file-actions {
  display: inline-block;
}
.nuclide-changed-file-action {
  display: inline-block;
}
.nuclide-changed-file-action:hover .icon::before {
  color: #d7dae0;
}
